            sentence += f"The first runway surface at {triple.subject} is {triple.object}. "
        elif triple.predicate == "icaoLocationIdentifier":
            sentence += f"The ICAO identifier for {triple.subject} is {triple.object}. "
        elif triple.predicate == "iataLocationIdentifier":
